import React from "react";

import NamelistItem from "./NamelistItem";

function Namelist(){
    const name=[
        {name:"Ahmed",age:10},
        {name:"Hello",age:12},
        {name:"How",age:30},
        {name:"Are",age:16}
    ];
    return(
        <div>
            <ul>
                <NamelistItem name={name.name[0]} age="19"/>
                <NamelistItem name="asd" age="15"/>
                <NamelistItem name="fdfd" age="11"/>
                <NamelistItem name="as" age="12"/>
            </ul>
        </div>
    );
}
export default Namelist;
